    false,nt"url": null,nt"notes": "In this project pop-up satellite tags were
    used to track the gross movement of ovigerous females and to locate the precise
    location of larval release.  The data, in turn, will be used to help to identify
    what areas represent important spawning areas, by implication habitats, and thus
    help managers decide on the trawl closure areas.  The gross movement of the female
    crabs will also help us understand movement patterns of red king crab in Bristol
    Bay and will provide important estimates of natural mortality rates for females
    during the inter-molt period.",nt"license_title": "License Not Specified",nt"extras":
